PR #19475 add two methods to one definition of ObjectID. However, there're two definitions of ObjectID in mongo.d.ts, so that PR introduce error for some. This PR fix that by updating the other definition of ObjectID.

@barbatus @fullflavedave @birkskyum @ardatan @stefanholzapfel
@kombadzomba

Allows creating and updating models via their `Model`'s static methods using partial keys ([see docs](http://docs.sequelizejs.com/class/lib/model.js~Model.html#static-method-update) for intended behavior). This enables the use of `--strictNullChecks` without having to define all attributes as optional:

#### before
```ts
interface UserAttrs {
  id?:    number;
  name?:  string;
  email?: string;
}
```

#### after
```ts
interface UserAttrs {
  id:    number;
  name:  string;
  email: string;
}
```

```ts
// ...
await User.update({
  name: 'Bob'
}, {
  where: { id: 1 }
});
```

